import React, {FunctionComponent} from 'react';
import Project from '../models/project';
import {statut} from '../models/statut';

type Props = {
    project: Project
};


const projectCard: FunctionComponent<Props> = ({project}) => {
    return (
        <div>
            <td className="col">Project Number: {project.ProjectNumber}</td>
            <td className="col">Project leader: {project.ProjectLeader}</td>
            <td className="col">Statut: {project.Statut}</td>
            <td className="col">Signature Date: {project.SignatureDate}</td>
        </div>
   
    )
};

export default projectCard;
